import React, { useState } from 'react';
import './Part.css';

function dispatchClick(setPlayed, setCurrentPlay, currentPlay) {
  setPlayed(true);
  setCurrentPlay(currentPlay === 1 ? 2 : 1);
}

function Part({ position, currentPlay, setCurrentPlay }) {
  const [played, setPlayed] = useState(false);
  return (
    <div
      onClick={() => dispatchClick(setPlayed, setCurrentPlay, currentPlay)}
      className={played ? `play${currentPlay}` : 'notPlayed'}
    ></div>
  );
}

export default Part;
